import React, {Component} from 'react';

class Section extends Component {
    render() {
        return (
            <>
                    <section>
                        <hr/>

                        <h2>projects I have done :</h2>


                        <img className="shadow" src="./imgs/Shadow.png" alt=""/>
                                <h3>maxway Site</h3>
                                <img src="./imgs/Gamburger.png" alt=""/>
                                <h3>
                                    This site is about pizza, and this site allows you to filter, cart, add items to cart, and view the total price.
                                </h3>
                                <button>
                                    READ MORE
                                </button>
                    </section>



            </>
        );
    }
}

export default Section;
